import React from 'react';

function Header() {
  return (
    <header>
      <h1>Instant Diaries</h1>
      <nav>
        <a href="#home">Home</a>
        <a href="#entries">Diary Entries</a>
        <a href="#about">About</a>
      </nav>
    </header>
  );
}

export default Header;
